import React from 'react';


class FinalPage extends React.Component {
  constructor() {
    super();
    this.state = { data: [] };
  }

  componentDidMount() {
    fetch('/FinalPage')
      .then(res => res.json())
      .then(json => this.setState({ data: json }));
  }

  render(){
    if (this.state.data.length===0)
        return (<p>ops</p>);
        // console.log(this.state.data[0]);
        // console.log(this.state.data[0].length);
    return(
      <div id="FinalPage">
      {this.state.data[0].symbol.map((item)=>{
        for (var i=0; i < this.state.data[0].symbol.length; i++) {
          <p>{this.state.data[0].symbol[i]}</p>
        }
        })}
     </div>
      )
  }
}

export default FinalPage
